import React,{useEffect} from "react";
import PropTypes from "prop-types";
import {Router,Link } from "react-router-dom";
import styles from "./styles.module.scss";

import { RenderAfterNavermapsLoaded } from 'react-naver-maps';
import {
  ComposedChart, LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend,
} from 'recharts';
import Navigation from "../Navigation";
import ReactLoading from 'react-loading';
import Helmet from 'react-helmet';
import { NaverMap, Marker } from 'react-naver-maps';
const Location = (props, context) => (
  
  <div className={styles.Location}>
    
    <div className={styles.map}>
      <div className={styles.title}>
            <span className={styles.bigTitle}>수리내역 조회</span>
            <span className={styles.samllTitle}>차량번호 뒷 4자리와 휴대폰번호로 수리진행 내역을 조회할 수 있습니다.</span>
      </div>
      <RenderAfterNavermapsLoaded	   // Render후 Navermap로드
                ncpClientId={'awv4p02rug'} // 자신의 네이버 계정에서 발급받은 Client ID
                error={<p>Maps Load Error</p>}
                loading={<p>Maps Loading...</p>}
            >
                <NaverMap
                    id="react-naver-maps-introduction"
                    style={{ width: '100%', height: '400px' }}
                    center={{ lat: 37.708617438379896, lng: 127.46599642522969 }}
                    defaultZoom={17}
                    
                >
                </NaverMap>
        </RenderAfterNavermapsLoaded>  
    </div>
    
  </div>
);

Location.propTypes = {
  loading: PropTypes.bool.isRequired,
  data : PropTypes.array.isRequired,
  summonername : PropTypes.string.isRequired,
  mmr : PropTypes.array.isRequired,
  mmrdate : PropTypes.array.isRequired,
};

export default Location;
